Sentencing hearing proceeded. Court finds the State has complied with victim's rights legislation. Statements made as to sentencing.

As to COUNT 1-

Court ordered defendant to serve 4 MONTHS in the House of Correction; credit for 3 days time served.

Court STAYED the sentence and placed defendant on probation for 12 MONTHS with the following conditions:

1) Complete a 30-40 hour counseling program. If defendant completes this program through private insurance, he is exempt from participating in the DOC's sex offender evaluation and treatment. If the program is not covered through insurance, defendant to participate in the DOC's program;
2) Pay all costs, fees and surcharges during period of probation. Failure to pay will result in a civil judgment;
3) Defendant is NOT required to submit a DNA sample. Court WAIVED DNA surcharge as this is an individual crime;
4) No contact with the victim;
5) Court set restitution at ZERO;

If revoked, defendant may have work release if employed at the time of revocation.

Expungment is authorized by the Court upon successful completion of probation.

Appellate rights notice given to the defendant. 
Filed;
Notice of Right to Seek Postconviction Relief;
Pretrial Incarceration Credit.
